alrovat.mezo:
A bíróság a 2010. december 17. napján 89. sorszámon elõterjesztett változás bejegyzése iránti kérelmet elutasítja.
A végzés ellen a cég a kézbesítéstõl számított 15 (tizenöt) napon belül, továbbá az, akire a végzés rendelkezést tartalmaz - a rendelkezés rá vonatkozó része ellen, a cég számára nyitva álló határidõn belül - a Fõvárosi Ítélõtáblához címzett, de a Somogy Megyei Bíróságnál, mint Cégbíróságnál 3 (három) példányban benyújtható fellebbezésnek van helye. A fellebbezés elsõ példányára 7.000.-Ft (hétezer forint) eljárási illetéket kell leróni. A Fõvárosi Ítélõtábla elõtti eljárásban a fellebbezést elõterjesztõ fél részére a jogi képviselet kötelezõ.
Ha a kérelmet elutasító végzés közlését követõ nyolc napon belül ugyanazon eljárás keretében ismételten kérik a változás bejegyzését, az elutasításhoz fûzõdõ jogkövetkezmények nem alkalmazhatók, és a korábbi eljárás során benyújtott okiratok - ideértve a korábbi eljárásban az illeték megfizetésérõl szóló igazolás is - ismételten felhasználhatók az új változásbejegyzési kérelemhez.
1.) a kérelem nyomtatványon a kérelem mellékletét képezõ okiratok felsorolásánál nem csupán a Ctv. 3. számú melléklet I. részében meghatározott okiratok kerültek feltüntetésre. A Ctv. 48.§ (2) bekezdése értelmében ugyanis a bejegyzési kérelemhez csatolandó okiratok felsorolását ezen melléklet I. része tartalmazza, így tehát a kérelem mellékletét képezõ okiratok felsorolásánál csak az ezen melléklet I. részében meghatározott okiratok tüntethetõek fel, minden további (és a Ctv. 3. számú melléklet II. része szerint is szükséges) okirat a kérelem mellékletét nem képezõ okiratok felsorolásánál tüntetendõ fel, becsatolásuk pedig nem szükséges (Ctv. 48.§ (3) és 50.§ (2) bekezdés, Fõvárosi Ítélõtábla 16.Cgf.44.137/2008/2. szám).
2.) a változásbejegyzést kérõ a kérelem mellékletét képezõ okiratok felsorolásánál elmulasztotta feltüntetni a jogszabályban meghatározott mértékû közzétételi költségtérítés megfizetését tanúsító okiratot és a vezetõ tisztségviselõ nyilatkozatát arról, hogy nem áll a Gt. 23.§-ában foglalt eltiltás hatálya alatt (Ctv. 48.§ (2) és 50.§ (2) bekezdés, 2009. évi LI. törvény 50.§ (20) bekezdés, Ctv. 3. számú melléklet I. rész 4. és 8. pont);
3.) a változásbejegyzést kérõ a kérelem mellékletét nem képezõ okiratok felsorolásánál elmulasztotta feltüntetni a Ctv. 2. számú melléklet II. rész 1.a./ pontjának af./ alpontjában meghatározott okiratot (Ctv. 48.§ (3) és 50.§ (2) bekezdés);
4.) a kérelem nyomtatvány a társasági szerzõdés adataitól eltérõen került kitöltésre. A szerzõdés - és a csatolt taggyûlési jegyzõkönyv - adatai szerint ugyanis a társaság cégneve, székhelye, jegyzett tõkéje nem változott, a kérelem nyomtatvány azonban az ezen adatok módosítására vonatkozó rovatokat is tartalmazza. A kérelem nyomtatványon csak a megváltozott adatokat tartalmazó rovatokat kell és szabad feltüntetni, a módosításra nem került adatokat tartalmazó rovatokat és alrovatokat nem, így a fentieken túlmenõen javítandó a kérelem nyomtatvány 6-os rovata és a tagi adatokat tartalmazó rovat is. (21/2006. (V.18.) IM. rendelet 10.§ (4) bekezdés);
5.) a kérelem nyomtatvány 13-as rovata az ügyvezetõk korábbi adatainak a törlésére vonatkozó alrovatokat nem tartalmaz (Ctv. 24.§ (1) bekezdés h./ pont, 21/2006. (V.18.) IM. rendelet 10.§ (4) bekezdés);
6.) a jogi képviselõnek a kérelembe foglalt nyilatkozata nem felel meg a jogszabályoknak, tekintettel arra, hogy
- a becsatolt taggyûlési jegyzõkönyv, tagjegyzék és Ctv. 3. számú melléklet I. részének 8. pontja szerinti vezetõ tisztségviselõi nyilatkozatok a társaság cégnevét nem megfelelõen - a korábban bejegyzésre került elnevezéstõl eltérõen - tartalmazzák (Törvényi elvárás, hogy a cég cégnevét minden okiraton azonos módon használja. Az egyes cégnév elemek elhagyása, újak beillesztése, illetõleg felcserélése a cégnév módosítását jelenti.)(Ctv. 24.§ (1) bekezdés b./ pont);
- a becsatolt tagjegyzék a társaság törzstõkéjének a mértékét nem tartalmazza (Ctv. 48.§ (2) és 50.§ (2) bekezdés, 2006. évi IV. törvény (Gt.) 150.§ (2) bekezdés c./ pont);
- a kérelem nyomtatvány és a létesítõ okirat 2.4. pontja Bene Szimonetta Dzsenifer tag anyja nevét pontatlanul tartalmazza (Ctv. 30.§ (1) bekezdés);
- a becsatolt okiratok ellentmondásos adatokat tartalmaznak. A becsatolt taggyûlési jegyzõkönyv tanúsága szerint a társaság tagjai a 2010. október 25. napján megtartott taggyûlésen határoztak Benéné Behány Gyöngyi és Magyar Tiborné Behány Erika határozatlan idõre szóló ügyvezetõvé történõ megválasztásáról, illetõleg a tagok üzletrészeinek felosztásáról és Bene Szimonetta Dzseniferre történõ átruházásáról, ezzel szemben azonban Bene Szimonetta Dzsenifer tagsági jogviszonyának kezdõ idõpontjaként a kérelem nyomtatványon 2010. november 30. napja került feltüntetésre, illetõleg a csatolt okiratokban a határozatlan idõre megválasztott ügyvezetõk megbízatásának kezdõ idõpontjaként is 2010. november 30. napja került megjelölésre. (Ctv. 24.§ (1) bekezdés h./ pont és 27.§ (3) bekezdés a./ pont)
2011. január 10.
